var http = require('http')
var manager = module.exports

var robotState = {}
var ROBOT_AMOUNT = 580
for(var i = 0;i < ROBOT_AMOUNT;i++){
	robotState[i] = true
}

var gameType = {
	"goldMingpai-1-gold" : 10,
	"goldMingpai-2-gold" : 50,
	"goldMingpai-3-gold" : 100,
	"goldMingpai-4-gold" : 1000,
	"goldMingpai-5-gold" : 5000,
	"goldNiuNiu-1-gold" : 10,
	"goldNiuNiu-2-gold" : 50,
	"goldNiuNiu-3-gold" : 100,
	"goldNiuNiu-4-gold" : 1000,
	"goldNiuNiu-5-gold" : 5000
}
manager.getRobotInfo = function(type,uid,cb) {
	if(!robotData[uid]){
		return
	}
	var data = {}
	data.diamond = 0
	data.uid = uid
	data.nickname = robotData[uid].nickname
	data.head = robotData[uid].icon
	data.history = []
	data.sex = Math.random() > 0.5 ? 1 : 2
	data.limits = 0
	data.freeze = 0
	data.useDiamond = 0
	data.contorl = 0
	var rate = gameType[type]
	if(rate){
		data.gold = Math.floor(Math.random() * (500 - 100) * rate) + rate * 100
	}else{
		return
	}
	data.diamond = data.gold
	data.isRobot = true
	data.charm = 0
	data.contorl = 0
	data.signature = "玩家很懒什么都没有留下"
	var refreshList = {}
	refreshList.lottoTime = 0 					//抽奖
	refreshList.lottoCount = 0 
	refreshList.bankruptTime = 0				//破产保护
	refreshList.bankruptTimeCount = 0
	refreshList.dayGoldTime = 0					//每日金币输赢
	refreshList.dayGoldValue = 0
	refreshList.charmTime = 0 					//今日魅力值
	refreshList.charmValue = 0
	data.refreshList = refreshList
    robotState[uid] = false
    cb(data,type)
}

manager.getUnusedRobot = function() {
	//获取未使用机器人ID
	var robotId = Math.floor((Math.random() * ROBOT_AMOUNT))
	for(var i = robotId;i < ROBOT_AMOUNT + robotId;i++){
		var index = (robotId % ROBOT_AMOUNT)
		if(robotState[index] == true){
			return index
		}
	}
	return false
}

manager.freeRobot = function(uid) {
	robotState[uid] = true
}



